" Ешьте финики,- спасете зубы" - арабская мудрость ☝️.
Мне лайк ❤? А вам вся правда о финиках🔥.
Финик в Коране упоминается более 20 раз в разных сурах. Согласно священной книге (сура Марьям), финики вселили силу в деву Марию после Рождения малыша Иисуса. Господь сказал роженице Марие, которую муки привели к финиковой пальме, давшей урожай вне сезона : " И потряси над собой ствол пальмы. Она уронит к тебе свежие, спелые. Ешь и пей и прохлади глаза." Спрос на "пустынные конфеты" всегда высок - и сейчас, и во времена бедуинов.
До нефтяной лихорадки, плоды пальм служили обывателям пустыни одним из главных источников пропитания. А в наше время, финики - самый популярный продукт, покупаемый туристами.
🌴Финики способствуют лечению опухолей ( т.к в плодах очень много селена);
🌴Перебродивший финиковый сок лечит заболевания ног у беременных женщин;
🌴Финики укрепляют зрительный и слуховой нервы и способствуют сохранению зрения и слуха;
🌴Финики богаты фтором, который защищает зубы от кариеса;
🌴Арабы называют финики "рудниками здоровья" , в них содержится большое количество углеводов, жиры и масла, медь, железо, магний, цинк, марганец, калий, фосфор, натрий, кадмий, кобальт, сера, бор, более 20 видов аминокислот,витамины А, А1, С, В1, В2, В6, соли и минералы трудно перечислить из-за их обилия;
🌴Бедуинские женщины знали более 100 рецептов блюд и отваров,которые можно приготовить из фиников и некоторые рецепты лично у меня вызывают недоумение и удивление. Например, если вы желаете отрастить и укрепить волосы, вам надо в воде прокипятить финиковые косточки с собачьей костью и ослинным копытом. Полученный раствор втирать в голову 🙄;
🌴Финики возбуждают половой интерес;
🌴 Съеденные утром натощак 7 фиников нейтрализуют попавший в организм яд ( т.е токсины) и предохраняют от козней колдунов в течении дня😉.
Если вам поставили диагноз - усталость надпочечников, попробуйте следующее сочетание продуктов на перекус в течении дня :
Финики (калий) + две веточки сельдерея (натрий) + яблоко (сахар).
Ешьте финики и берегите себя!🙏
